/*Table structure for table `bonus_batch_setting` */

CREATE TABLE `bonus_batch_setting` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL,
  `activity_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '红包活动主键',
  `company_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '所属公司主键',
  `prod_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '所属产品主键',
  `batch_no` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '产品批次',
  `bonus_type` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '红包方式，0表示现金红包，1表示企业付款到零钱',
  `bonus_amount_type` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '红包金额类型，0表示固定金额红包，1表示随机金额红包',
  `bonus_qrcode_number` int(10) DEFAULT NULL COMMENT '防伪码数量',
  `win_chance` varchar(3) COLLATE utf8_bin DEFAULT NULL COMMENT '红包中奖概率',
  `bonus_amount` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '红包金额',
  `bonus_switch` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '红包开关',
  `create_by` varchar(64) COLLATE utf8_bin DEFAULT NULL,
  `create_date` datetime DEFAULT NULL,
  `update_by` varchar(64) COLLATE utf8_bin DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  `del_flag` char(1) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

