/*Table structure for table `bonus_history` */

CREATE TABLE `bonus_history` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `qrcode` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '防伪码',
  `prod_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '防伪码所属产品',
  `company_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '防伪码所属公司',
  `activity_setting_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '红包活动主键',
  `batch_setting_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '红包批次主键',
  `open_id` varchar(40) COLLATE utf8_bin DEFAULT NULL COMMENT '微信用户openid',
  `amount` decimal(6,0) DEFAULT NULL COMMENT '红包金额',
  `status` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '红包发送状态，1表示红包发送成功，0表示没有中奖',
  `order_no` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '商户订单号',
  `wechat_order_no` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '微信业务单号',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `del_flag` char(1) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=268 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

