  `id` varchar(64) COLLATE utf8_bin NOT NULL,
  `code_pre` varchar(10) COLLATE utf8_bin DEFAULT NULL,
  `code_type` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '登记类别代码（1登记类别代码为PD 2登记类别代码为WP 3临时登记）',
  `djz_last` varchar(6) COLLATE utf8_bin DEFAULT NULL COMMENT '登记证后六位',
  `sc_type` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '生产类型',
  `code_spec` char(3) COLLATE utf8_bin DEFAULT NULL COMMENT '产品规格码',
  `code_radom` varchar(21) COLLATE utf8_bin DEFAULT NULL COMMENT '随机码',
  `status` char(1) COLLATE utf8_bin DEFAULT NULL,
  `create_by` varchar(64) COLLATE utf8_bin DEFAULT NULL,
  `create_date` datetime DEFAULT NULL,
  `update_by` varchar(64) COLLATE utf8_bin DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  `del_flag` char(1) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='生码规则';

/*Data for the table `bs_code_rule` */

/*Table structure for table `bs_dealer` */

CREATE TABLE `bs_dealer` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL,
  `dealer_no` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '经销商编号',
  `dealer_name` varchar(150) COLLATE utf8_bin DEFAULT NULL COMMENT '经销商名',
  `account` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '账号',
  `password` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '密码',
  `grade` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '等级',
  `certificateUrl` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '证件图片',
  `company_id` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '公司id',
  `parent_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '上级id',
  `parent_ids` varchar(2000) COLLATE utf8_bin DEFAULT NULL COMMENT '上级ids',
  `sales_area_id` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '销售区域',
  `address` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '地址',
  `latitude` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '维度',
  `longitude` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '经度',
  `email` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `fax` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `phone` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `qq` varchar(20) COLLATE utf8_bin DEFAULT NULL,
  `wechat` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `dealer_info` longtext COLLATE utf8_bin COMMENT '介绍',
  `dealer_jianma` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '简码',
  `remark` varchar(500) COLLATE utf8_bin DEFAULT NULL,
  `create_by` varchar(64) COLLATE utf8_bin DEFAULT NULL,
  `create_date` datetime DEFAULT NULL,
  `update_by` varchar(64) COLLATE utf8_bin DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  `del_flag` char(1) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='经销商表';

