/*Table structure for table `bs_product` */

CREATE TABLE `bs_product` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL,
  `prod_no` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '产品编号',
  `reg_type` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '登记类别代码（1登记类别代码为PD 2登记类别代码为WP 3临时登记）',
  `reg_code` varchar(6) COLLATE utf8_bin DEFAULT NULL COMMENT '登记证号',
  `pesticide_name` varchar(150) COLLATE utf8_bin DEFAULT NULL COMMENT '农药名',
  `prod_name` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '产品名称',
  `reg_crop` varchar(150) COLLATE utf8_bin DEFAULT NULL COMMENT '证件所属公司',
  `company_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '生产企业',
  `prod_spec` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '产品规格',
  `pack_rate` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '包装比例',
  `sc_type` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '生产类型',
  `prod_unit` varchar(3) COLLATE utf8_bin DEFAULT NULL COMMENT '单位',
  `prod_manager` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '产品经理',
  `isUser` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '是否启用',
  `img_url` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '图片路径',
  `remark` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  `prod_type` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '产品分类',
  `point_value` smallint(4) DEFAULT NULL COMMENT '查询防伪码获得积分',
  `prod_content` longtext COLLATE utf8_bin COMMENT '产品内容',
  `create_by` varchar(64) COLLATE utf8_bin NOT NULL,
  `create_date` datetime DEFAULT NULL,
  `update_by` varchar(64) COLLATE utf8_bin DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  `del_flag` char(1) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `index_companyid` (`company_id`)
