/*Table structure for table `fwm_qrcode` */

CREATE TABLE `fwm_qrcode` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL,
  `qrCode` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '防伪码',
  `box_code` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '箱码',
  `verification_code` varchar(4) COLLATE utf8_bin DEFAULT NULL COMMENT '验证码',
  `plan_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '任务号',
  `status` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '状态',
  `select_num` bigint(20) DEFAULT NULL COMMENT '查询数',
  `prod_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '产品id',
  `file_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '防伪码文件id',
  `create_by` varchar(64) COLLATE utf8_bin DEFAULT NULL,
  `create_date` datetime DEFAULT NULL,
  `update_by` varchar(64) COLLATE utf8_bin DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  `del_flag` char(1) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `index_plan_id` (`plan_id`) USING BTREE,
  KEY `index_update_date` (`update_date`),
  KEY `index_del_flag` (`del_flag`),
  KEY `index_qrcode` (`qrCode`),
  KEY `index_prodId` (`prod_id`),
  KEY `index_fileId` (`file_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='防伪码';

