/*Table structure for table `fwm_qrcode_files` */

CREATE TABLE `fwm_qrcode_files` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL,
  `order_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '单号',
  `old_file_name` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `file_name` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '文件名',
  `code_num` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '码数',
  `parse_success` varchar(20) COLLATE utf8_bin DEFAULT NULL,
  `parse_fail` varchar(20) COLLATE utf8_bin DEFAULT NULL,
  `create_by` varchar(64) COLLATE utf8_bin DEFAULT NULL,
  `create_date` datetime DEFAULT NULL,
  `update_by` varchar(64) COLLATE utf8_bin DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  `del_flag` char(1) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

/*Data for the table `fwm_qrcode_files` */

/*Table structure for table `fwm_qrcode_invalid` */

CREATE TABLE `fwm_qrcode_invalid` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL,
  `qrCode` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '防伪码',
  `query_date` datetime DEFAULT NULL COMMENT '查询日期',
  `query_type` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '类型',
  `query_source` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '来源',
  `query_result` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '结果',
  `create_by` varchar(64) COLLATE utf8_bin DEFAULT NULL,
  `create_date` datetime DEFAULT NULL,
  `update_by` varchar(64) COLLATE utf8_bin DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  `longitude` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '经度',
  `latitude` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '维度',
  `address` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '地址信息',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='防伪查询记录表';

/*Data for the table `fwm_qrcode_invalid` */

