/*Table structure for table `outbound_dealer` */

CREATE TABLE `outbound_dealer` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '主键',
  `bound_no` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '出库计划单号',
  `inDealer_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '收货方经销商主键',
  `outDealer_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '发货方经销商主键',
  `status` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '0表示待发货，1表示已发货，2表示已收货',
  `bound_date` datetime DEFAULT NULL COMMENT '出库时间',
  `receive_date` datetime DEFAULT NULL COMMENT '收货时间',
  `ship_no` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '物流单号',
  `ship_name` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '物流名称',
  `pdaUser_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '出库员',
  `remarks` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  `create_by` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '创建人主键',
  `create_date` datetime DEFAULT NULL COMMENT '创建日期',
  `update_by` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '更新人主键',
  `update_date` datetime DEFAULT NULL COMMENT '更新日期',
  `del_flag` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '逻辑删除标志位',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=COMPACT;

