/*Table structure for table `outbound_product` */

CREATE TABLE `outbound_product` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '主键',
  `outBound_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '出库计划表主键',
  `prod_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '产品主键',
