/*Table structure for table `sc_plan` */

CREATE TABLE `sc_plan` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL,
  `plan_no` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '计划号',
  `made_date` datetime NOT NULL COMMENT '生产日期',
  `lline_id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '流水线id',
  `remark` varchar(500) COLLATE utf8_bin NOT NULL COMMENT '备注',
  `prod_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '产品id',
  `batch_no` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '批号',
  `plan_number` int(11) DEFAULT NULL COMMENT '计划生产数量',
  `real_number` int(11) DEFAULT NULL COMMENT '实际生产量',
  `indate` datetime DEFAULT NULL COMMENT '有效期',
  `status` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '1草稿2确认3审核(未生产)4生产中5完工',
  `qc_count` int(2) DEFAULT NULL COMMENT '质检没有通过次数',
  `operate_by` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '操作员',
  `qc_by` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '质检员',
  `check_plan_url` varchar(150) COLLATE utf8_bin DEFAULT NULL COMMENT '检验报告单',
  `create_by` varchar(64) COLLATE utf8_bin DEFAULT NULL,
  `create_date` datetime DEFAULT NULL,
  `update_by` varchar(64) COLLATE utf8_bin DEFAULT NULL,
  `update_date` datetime DEFAULT NULL,
  `del_flag` char(1) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='计划任务表';

